description:
One of Tatu's early concerts, this one was shot in Krasnodar on 18 October 2001.

65 min mpeg2 720x576 25fps

[http://www.tatu.us/forum/viewtopic.php?t=18298]

Posted by Matvei, on tatysite.net:

Hare sent me a VHS with the concert in Krasnodar 18.10.2001. I've cap it and uploaded it to tatulife.ru. The duration of the video is 1 hour and 5 minutes. 

